import React, {useState} from 'react';

const MenuItem = (props) => {

    const { name, subMenus } = props;
    const {expand, setExpand } = useState(false);

    return(
        <li>
            <i className="zmdi zmdi-view-dashboard" style={{color: "bisque", fontSize: "1rem", marginLeft: "40%", marginRight: '-38.5%', display: "inline-block" }}> </i>
            <a className={'menu-item'}> <span> {name} </span> </a>

            {
                subMenus && subMenus.length > 0
                    ?
                    <ul className={"submenu"}>
                        {subMenus.map((menu, index) =>
                            <li key={index} >
                            <a className={'sub-menu-item'}> <span> {menu.name} </span> </a>
                            </li>
                        )}
                    </ul>
                    :
                    null
            }

            <div className={'divider-two'}> </div>
        </li>
    )
}
export default MenuItem;
